import React from 'react'
import '../App.css';

const Dashboard = ({cps}) => {
    return (
        <div>
            <center><h1>App List  (Hello!!)</h1></center>
            {cps && cps.map((cp) => (
                <div class="card" key={cp.id}>
                    <div class="card-body">
                        <div class="card-title">ID: {cp.id}</div>
                        <div class="card-title">Port: {cp.occupied}</div>
                        <div class="card-title">Repo: {cp.power}</div>
                        <div class="card-title">Created Date: { Date(cp.connectedTime)}</div>
                    </div>
                </div>
            ))}
        </div>
    )
};

export default Dashboard
